MongoDB Atlas connections to cluster(s) exceeded- NextJS + NextAuth<p>I was creating a website using NextJS and for authentication uses NextAuth. And the database is on free tier in MongoDB Atlas.</p>
<p>I have two versions of code for database connection. One is this:</p>
<pre><code>/**
 *      MongoDB Connection
 * 
 *  */
import mongoose from 'mongoose'

const MONGODB_URI = process.env.MONGODB_URL

if (! process.env.MONGODB_URL) {
  throw new Error(
    'Please define the MONGODB_URI environment variable inside .env.local'
  )
}

/**
 * Global is used here to maintain a cached connection across hot reloads
 * in development. This prevents connections growing exponentially
 * during API Route usage.
 */
let cached = global.mongoose

if (!cached) {
  cached = global.mongoose = { conn: null, promise: null }
}

async function dbConnect() {
  if (cached.conn) {
    return cached.conn
  }

  if (!cached.promise) {
    const opts = {
      useNewUrlParser: true,
      useUnifiedTopology: true,
      bufferCommands: false,
    //   bufferMaxEntries: 0,
    //   useFindAndModify: false,
    //   useCreateIndex: true,
    }

    cached.promise = mongoose.connect(process.env.MONGODB_URL, opts).then((mongoose) =&gt; {
      return mongoose
    })
  }
  cached.conn = await cached.promise
  return cached.conn
}

export default dbConnect
</code></pre>
<p>So, before making any DB related queries via code, I call <code>await dbConnect()</code>. It is working fine.</p>
<p>But for storing the sessions in DB, in NextAuth, I was not able to use the above function. So for that, am using this custom code (/lib/mongodb.js):</p>
<pre><code>/**
 * 
 *      Used only for Next-Auth
 * 
 */

import { MongoClient } from &quot;mongodb&quot;

const uri = process.env.MONGODB_URL
const options = {
  useUnifiedTopology: true,
  useNewUrlParser: true,
}

let client
let clientPromise

if (!process.env.MONGODB_URL) {
  throw new Error(&quot;Please add your Mongo URI to .env.local&quot;)
}

if (process.env.NODE_ENV === &quot;development&quot;) {
  // In development mode, use a global variable so that the value
  // is preserved across module reloads caused by HMR (Hot Module Replacement).
  if (!global._mongoClientPromise) {
    client = new MongoClient(uri, options)
    global._mongoClientPromise = client.connect()
  }
  clientPromise = global._mongoClientPromise
} else {
  // In production mode, it's best to not use a global variable.
  client = new MongoClient(uri, options)
  clientPromise = client.connect()
}

// Export a module-scoped MongoClient promise. By doing this in a
// separate module, the client can be shared across functions.
export default clientPromise
</code></pre>
<p>And the code in my <strong>/pages/api/auth/[...nextauth].js</strong> is like this:</p>
<pre><code>import NextAuth from 'next-auth'
import { MongoDBAdapter } from &quot;@next-auth/mongodb-adapter&quot;
import mongodb from '../../../lib/mongodb'
//...

export default async function auth(req, res) {
    return await NextAuth(req, res, {    
        //....

        adapter: MongoDBAdapter({
            db: (await mongodb).db(&quot;my_db_name_here&quot;)            
        }),

        //....
    })
}
</code></pre>
<p>Here's the packages am using:</p>
<pre><code>&quot;mongodb&quot;: &quot;^4.1.2&quot;,
&quot;mongoose&quot;: &quot;^6.0.1&quot;,    
&quot;next&quot;: &quot;11.0.1&quot;,
&quot;next-auth&quot;: &quot;^4.0.0-beta.6&quot;,
&quot;react&quot;: &quot;17.0.2&quot;,
&quot;react-dom&quot;: &quot;17.0.2&quot;,
</code></pre>
<p>The problem is, am receiving email notifications sometimes like the following:</p>
<p><a href="https://i.stack.imgur.com/aDQIc.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/aDQIc.png" alt="enter image description here" /></a></p>
<p>My website is still in testing phase(tested by two persons only) and is hosting in Vercel server. I believe this could be because NextAuth is creating new db connections each time? Any thoughts on what went wrong?</p>

