mongoDb - How to ensure unique item in an array based on specific fields?<p>Inspired by <a href="https://stackoverflow.com/questions/10383143/how-to-ensure-unique-item-in-an-array-based-on-specific-fields-mongodb">another question</a>, suppose I have documents that contain an array of events, where each event has 3 fields: <code>eventName</code>, <code>actorId</code>, and <code>detail</code>:</p>
<pre><code>  {
    _id: ObjectId(&quot;5a934e000102030405000000&quot;),
    date: ISODate(&quot;2022-06-03T00:00:00.000Z&quot;),
    events: [
      {
        eventName: &quot;Add&quot;,
        actorId: &quot;1&quot;,
        detail: &quot;new actor&quot;
      },
      {
        eventName: &quot;Vote&quot;,
        actorId: &quot;2&quot;,
        detail: &quot;up&quot;
      },
      {
        eventName: &quot;Vote&quot;,
        actorId: &quot;3&quot;,
        detail: &quot;down&quot;
      },
      {
        eventName: &quot;Vote&quot;,
        actorId: &quot;4&quot;,
        detail: &quot;cork&quot;
      }
    ]
  }
</code></pre>
<p>I want to add new items into a specific document (according to its <code>_id</code>), but each item can be added only if none of the existing items as the same <code>eventName</code> and <code>actorId</code> unique combination.</p>
<p>For example trying to add:</p>
<pre><code>[
    {
     eventName: &quot;Add&quot;,
     actorId: &quot;3&quot;,
     detail: &quot;action&quot;
   },
   {
     eventName: &quot;Vote&quot;,
     actorId: &quot;2&quot;,
     detail: &quot;up&quot;
