<p>However, after i submit, i receive <strong>only</strong> text inputs in my database. The chosen file (desired to upload) doesn't appear at all in the database. I am expecting to get all the data form (the uploaded file and text inputed) in my database.</p>
<p>I tested my backend and it works correctly (it uploads <strong>all</strong> the inputs).</p>
<p>Ps: In browser, when i select a file (.pdf) to upload, the file input always shows <strong>no file chosen</strong> !</p>
<p><strong>Console.dev : Error</strong></p>
<pre><code>{title: 'Miss', fname: 'zaezae', lname: 'zaeazee', email: 'zaea@mail.com', phoneNumber: '12345678', }
coverLetter: &quot;zaez e az ezae e zae aeae  &quot;
cv: &quot;&quot;
email: &quot;zaea@mail.com&quot;
fname: &quot;zaezae&quot;
lname: &quot;zaeazee&quot;
myFile: &quot;C:\\fakepath\\test.pdf&quot;
phoneNumber: &quot;12345678&quot;
title: &quot;Miss&quot;

Formulaire.jsx:29
Uncaught (in promise) TypeError: Cannot read properties of undefined (reading 'then')
at submit (Formulaire.jsx:29:1)
</code></pre>
<p><strong>Backend:</strong></p>
<p><strong>server.js:</strong></p>
<pre><code>const express = require('express')
const mongoose = require('mongoose')
const bodyparser = require('body-parser')

const FormRoute = require('./routes/FormRoute')

//database
mongoose.connect('mongodb://localhost:27017/form', { useNewUrlParser: true, useUnifiedTopology: true })
const db = mongoose.connection

db.on('error', (err) =&gt; {
  console.log(err)
})
db.once('open', () =&gt; {
  console.log(&quot;Database connection established!&quot;)
})


//app
const app = express()

app.use(bodyparser.urlencoded({ extended: true }))
app.use(bodyparser.json())

//cors
const cors = require('cors')
app.use(cors())

//server run
const PORT = process.env.PORT || 5000
app.listen(PORT, () =&gt; {
  console.log(`Server is running on port ${PORT}`);
})

app.use('/api/form', FormRoute);
</code></pre>
<p><strong>Axios.js:</strong></p>
<pre><code>import axios from 'axios'

export const Axios = axios.create({
    baseURL: 'http://localhost:5000',
})
</code></pre>
<p><strong>Apiroutes.js:</strong></p>
<pre><code>const form = &quot;/api/form&quot;


export const requests = {
    formApi: {
        store: form + '/store'
    }
}
</code></pre>
<p><strong>formservices.js:</strong></p>
<pre><code>import { Axios } from &quot;../config/axios&quot;;
import { requests } from &quot;../config/apiroutes&quot;;

export const FormService = {
    store: (data) =&gt; {
        Axios.post(requests.formApi.store, data)
            .then(res =&gt; {
                return res
            })
            .catch(err =&gt; {
                return err
            })
    }
}
</code></pre>
<p><strong>formController.js :</strong></p>
<pre><code>const form = require('../models/FormModel')


const store = (req, res, next) =&gt; {
    let candidate = new form({
        title: req.body.title,
        fname: req.body.fname,
        lname: req.body.lname,
        email: req.body.email,
        phoneNumber: req.body.phoneNumber,
        coverLetter: req.body.coverLetter
    })
    if (req.file) {
        candidate.cv = req.file.path
    }
    candidate.save()
        .then(response =&gt; {
            res.json({
                success: true,
                message: 'Candidate added successfully!',
                data: candidate,
            })
        })
        .catch(error =&gt; {
            res.json({
                success: false,
                message: 'An error occured!',
